    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "ERC20: Transfer amount must be greater than zero");

        _beforeTokenTransfer(sender, recipient, amount);

        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balances[sender] = senderBalance - amount;
        }

        uint256 contractTokenBalance = balanceOf(address(this));
        bool overMinTokenBalance = contractTokenBalance >= numTokensSellToAddToLiquidity;
        if (!inSwapAndLiquify && swapAndLiquifyEnabled && overMinTokenBalance && recipient == uniswapV2Pair) {
            contractTokenBalance = numTokensSellToAddToLiquidity;
            //add liquidity
            swapAndLiquify(contractTokenBalance);
        }

        if(_isExcludedFromFee[sender] || _isExcludedFromFee[recipient] ){
            _balances[recipient] += amount;
            emit Transfer(sender, recipient, amount); 
        } else{
            // if(sender == uniswapV2Pair)//buy
            if(sender != uniswapV2Pair && recipient != uniswapV2Pair) {
                if(transferFeeEnabled){
                    transferBuFee(sender, recipient, amount);
                }else{
                    _balances[recipient] += amount;
                    emit Transfer(sender, recipient, amount); 
                }
            }else{
                 transferBuFee(sender, recipient, amount);
            }
            
        }

        _afterTokenTransfer(sender, recipient, amount);

    }

    function transferBuFee(address sender,address recipient,uint256 amount) private {
        if(transferAmount > 0)
            require(amount <= transferAmount, "TEN: Transfer amount must be less than 2");
        uint burnAmount = amount * _burnFee / 1000;
        uint marketAmount = amount * _marketFee / 1000;
        uint liquidityAmount = amount * _liquidityFee / 1000;
        uint sendAmount = amount - burnAmount - marketAmount - liquidityAmount;
    
        _balances[address(this)] += liquidityAmount;
        _balances[marketAddress] += marketAmount;
        _balances[address(0)] += burnAmount;
        _balances[recipient] += sendAmount;
        

        emit Transfer(sender, address(this), liquidityAmount);
        emit Transfer(sender, marketAddress, marketAmount);
        emit Transfer(sender, address(0), burnAmount);
        emit Transfer(sender, recipient, sendAmount);
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing
     * the total supply.
     *
     * Emits a {Transfer} event with `from` set to the zero address.
     *
     * Requirements:
     *
     * - `account` cannot be the zero address.
     */
    function mint(address account, uint256 amount) public onlyOwner  {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    /**
